import React from 'react';
import styled from "styled-components";
import Swiper from 'react-id-swiper';
import homeIllustration1 from "../assets/screenshot1.jpeg"
import homeIllustration2 from "../assets/screenshot2.jpg"
import homeIllustration3 from "../assets/screenshot3.jpg"

const CarouselImage = styled.img`
  max-width: 57%;
  object-fit: cover;
  border-radius: 10px;
  @media (max-width: 768px) {
    width: auto;
  }
`;

const HomeCarousel = () => {
  const params = {
    effect: 'flip',
    grabCursor: true,
    pagination: {
      el: '.swiper-pagination'
    },
    navigation: {
      nextEl: '.swiper-button-next',
      prevEl: '.swiper-button-prev'
    }
  } 
      return (
        <Swiper {...params}>
          <CarouselImage src={homeIllustration1} />
          <CarouselImage src={homeIllustration2} />
          <CarouselImage src={homeIllustration3} />
        </Swiper>
      )
    };

export default HomeCarousel
